import React from 'react'

const lakshmi = () => {
    const [name, setName] = useState("");
    const [showLogout, setShowLogout] = useState(true);
  
    async function logout() {
      console.log("This is logout fetch");
      const logoutFetch = await fetch("https://localhost:8443/onlineexamapplication/control/userLogout");
      const logoutResponse = await logoutFetch.json();
      console.log(logoutResponse.isUserLogin);
      if (logoutResponse.isUserLogin === true) {
        setShowLogout(false);
        window.location.href = '/';
      }
    }
  
    const validateLoginForm = (key, value) => {
      switch (key) {
        case "username":
          var validation = "[a-z0-9]+[@]{1}[a-z]{5}[.]{1}[com]";
          var regex = RegExp(validation);
  
          if (value === "") {
            document.getElementById("error_username").classList.remove('d-none');
            document.getElementById("error_username").classList.add('d-block');
            document.getElementById("error_username").innerHTML = "*Please enter a username";
          } else {
            if (!regex.test(value)) {
              document.getElementById("error_username").classList.remove('d-none');
              document.getElementById("error_username").classList.add('d-block');
              document.getElementById("error_username").innerHTML = "*Please enter a valid username";
            }
          }
          break;
        case "password":
          if (value === "") {
            document.getElementById("error_password").classList.remove('d-none');
            document.getElementById("error_password").classList.add('d-block');
            document.getElementById("error_password").innerHTML = "*Please enter a password";
          } else {
            document.getElementById("error_password").classList.add('d-none');
          }
          break;
        default:
          break;
      }
    };
  
    const handler = async (e) => {
      e.preventDefault();
      const data = new FormData(e.target);
      const value = Object.fromEntries(data.entries());
      document.getElementById("error_username").classList.add('d-none');
      document.getElementById("error_password").classList.add('d-none');
  
      try {
        const response = await fetch("https://localhost:8443/onlineexamapplication/control/checkLogin", {
          method: 'POST',
          credentials: 'include',
          body: JSON.stringify({ username: value.username, password: value.password }),
          headers: {
            'Content-Type': 'application/json',
            'Accept': 'application/json',
          },
        });
  
        const values = await response.json();
        console.log(values);
  
        const backendResult = values.isAdmin;
        const lastName = values.lastName;
  
        if (backendResult === true) {
          setName(lastName);
          setShowLogout(false);
  
          // Redirect to the admin page
          window.location.href = "/admin";
        }
  
        console.log(lastName);
        console.log(backendResult);
        
      } catch (error) {
        console.error('Error:', error);
      }
    };
  
    return (
      <div>
        <div className="container-fluid">
          <div className="row">
            <nav className="navbar navbar-expand-md bg-secondary navbar-dark custom-navbar">
              <div className="col-md-4 col-sm-12 navbar-brand">
                <img src={logo} alt="Online Exam Logo" className="custom-logo rounded-circle" />
              </div>
              <div className="col-md-4 col-sm-12 text-center">
                <h3>Online Exam</h3>
              </div>
  
  
              {/* button */}
              <div className="col-md-4 col-sm-12 text-center">
                <center>
  
  
                  {showLogout ? (
                     <button className="btn btn-light btn-lg" onClick={logout}>
                      Logout
                    </button>
                  ) : (
                    <button
                      className="btn btn-light btn-lg"
                      data-bs-toggle="modal"
                      data-bs-target="#enroll"
                    >
                      Login
                    </button>
                  )}
                </center>
              </div>
  {/* loginbutton logoutbutton div start */}
              {showLogout ? (
                <></>
              ) : (
                <div className="modal fade" id="enroll" tabIndex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
                  <div className="modal-dialog modal-dialog-centered">
                    <div className="modal-content">
                      <form onSubmit={handler}>
                        <div className="modal-header bg-secondary">
                          <p className="modal-title text-light fs-2">Login</p>
                        </div>
                        <div className="modal-body col-sm-10 offset-md-1">
                          <div className="row mt-2">
                            <label htmlFor="userInput" className="text-dark"><h5>Username</h5></label>
                            <input type="text" className="form-control border border-3" id="userInput" placeholder="Enter Username" name="username" />
                            <p id="error_username" className="d-none mb-0 text-danger"></p>
                            <label htmlFor="UserPassword" className="text-dark mt-4"><h5>Password</h5></label>
                            <input type="password" className="form-control border border-3" id="UserPassword" placeholder="Enter Password" name="password" />
                            <p id="error_password" className="d-none mb-0 text-danger"></p>
                          </div>
                        </div>
                        <div className="row mb-2 px-3">
                          <div className="col-8 gx-5">
                            <span className="text-dark">If you don't have an account <a href="#">Register Here</a></span>
                          </div>
                          <div className="col-4">
                            <button className="btn btn-secondary text-center">Login</button>
                          </div>
                        </div>
                      </form>
                    </div>
                  </div>
                </div>
              )}
  {/* loginbutton logoutbutton div end */}
  
            </nav>
          </div>
        </div>
      </div>
    );
}

export default lakshmi
